import React from 'react';

function Post({ post }) {
    return (
        <div className="post">
            <h3>{post.title}</h3>
            <p>{post.content}</p>
            <div>
                {post.images && post.images.length > 0 ? (
                    post.images.map((image, index) => (
                        <img key={index} src={image} alt={`Imagem ${index + 1}`} />
                    ))
                ) : (
                    <p>Sem imagens associadas a este post.</p>
                )}
            </div>
        </div>
    );
}

export default Post;
